    "devils-lake-wetland-management-district-annual-narrative-report-calendar-year-1987",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Devil's
    Lake WMD, Lake Alice NWR, and Sullys Hill National Game Preserve outlines Refuge
    accomplishments during the 1987 calendar year. The report begins with a summary
    of the year's highlights and weather conditions. Land acquisition is covered. The
    report includes a planning section which discusses the master plan, management planning,
    and compliance with environmental and cultural resource mandates. Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, volunteer
    programs, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include wetlands, forests, croplands, grasslands, grazing,
    haying, fire management, pest control, water rights, wilderness areas, and WPA easements.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, fisheries resources, wildlife propagation, animal control, and disease
    control. The public uses of the Refuge described in this report include interpretive
    programs, hunting, trapping, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, communication
    systems, and energy conservation. Cooperative programs and items of interest are
    provided at the end.",nt"license_title": "License Not Specified",nt"extras":
